import React from "react";
import { Container, Row, Col, Form } from "react-bootstrap";
import "./style.css";


const Contact = () => {
    return (
        <div style={{ paddingTop: "120pt", paddingBottom: "120pt", background: "white"}}>
        <Container>
        <Row>
        <Col>
        <h1>fdfsf</h1>
        </Col>
        <Col>
        <div style={{padding: "100pt", background: "white", borderRadius: "4pt", boxShadow: "1pt 1pt 1pt 1pt grey"}}>
            <Container>
                <h1>Contact Us</h1>
                <Form.Control /><br />
                <Form.Control />
            </Container>
        </div>
        </Col>
        </Row>
        </Container>
        </div>
    )
}

export default Contact;
